CaveShop::CaveShop()
{

	Init();
	DrawOwnScn();

}

CaveShop::~CaveShop()
{
}

void CaveShop::Update(Vector2 offset)
{

	mOffset = { offset.x_,offset.y_ };

}

void CaveShop::DrawOwnScn()
{

	for (int y = 0; y < MAP_Y; y++)
	{
		for (int x = 0; x < MAP_X; x++)
		{
			

			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[cs_ground[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[cs_obj[y][x]], true);
			/*DrawFormatString(32 * x - mOffset.X, 32 * y - mOffset.Y, GetColor(255, 255, 255), "%d", mMap[y][x]);*/

		}
	}

}

bool CaveShop::Init(void)
{

	if (LoadDivGraph("./image/A1.png", 378, 9, 42, 32, 32, &mChipImage[0]) == -1)
	{
		return false;
	}

	return true;
}

bool CaveShop::CheckMapChip(Vector2 pos)
{
	
	layer1 = cs_ground[pos.y_ / 32][pos.x_ / 32];
	layer2 = cs_obj[pos.y_ / 32][pos.x_ / 32];


	bool flg = true;	//true=player

		//s
	switch (layer1)
	{
		
	case 73:
	
		switch(layer2)
		{

		case 18:
		case 20:
		case 138:
		{
			flg = false;
			break;
		}
			break;
		default:
			break;
		}

		break;
	default:
		break;
	}

	return flg;

}

int CaveShop::GetMapChip(Vector2 pos)
{
	return cs_ground[pos.y_ / 32][pos.x_ / 32];;
}

int CaveShop::GetTMapChip(Vector2 pos)
{
	return cs_ground[pos.y_ / 32][pos.x_ / 32];;
}
